#include "NumArray.h"
#include <cassert>

range_sum_query_mutable::Node * range_sum_query_mutable::NumArray::getRoot(vector<int> &nums, int start, int finish) {
    if (start == finish) {
        auto tmp = new range_sum_query_mutable::Node(start, finish, nums[start], nullptr, nullptr);
        return tmp;
    }

    int middle = (finish + start) / 2;
    auto left = getRoot(nums, start, middle);
    auto right = getRoot(nums, middle + 1, finish);
    auto root = new range_sum_query_mutable::Node(start, finish, left->sum + right->sum, left, right);
    return root;
}

range_sum_query_mutable::NumArray::NumArray(vector<int> &nums) {
    head = getRoot(nums, 0, nums.size() - 1);
}

void dfs_update(range_sum_query_mutable::Node* root, int index, int val) {
    if (root->start == index and root->finish == index) {
        root->sum = val;
        return;
    }

    if (root->left and root->left->start <= index and root->left->finish >= index) {
        dfs_update(root->left, index, val);
    } else {
        dfs_update(root->right, index, val);
    }
    int sum = 0;
    if (root->left) sum += root->left->sum;
    if (root->right) sum += root->right->sum;
    root->sum = sum;
}

void range_sum_query_mutable::NumArray::update(int index, int val) {
    dfs_update(head, index, val);
}

int dfs_range(range_sum_query_mutable::Node* root, int left, int right) {
    if (left <= root->start and root->finish <= right) return root->sum;

    int sum = 0;
    if (root->left and left <= root->left->start and root->left->start <= right) {
        sum += dfs_range(root->left, left, right);
    } else if (root->left and left <= root->left->finish and root->left->finish <= right) {
        sum += dfs_range(root->left, left, right);
    } else if (root->left and root->left->start <= left and left <= root->left->finish) {
        sum += dfs_range(root->left, left, right);
    } else if (root->left and root->left->start <= right and right <= root->left->finish) {
        sum += dfs_range(root->left, left, right);
    }

    if (root->right and left <= root->right->start and root->right->start <= right) {
        sum += dfs_range(root->right, left, right);
    } else if (root->right and left <= root->right->finish and root->right->finish <= right) {
        sum += dfs_range(root->right, left, right);
    } else if (root->right and root->right->start <= left and left <= root->right->finish) {
        sum += dfs_range(root->right, left, right);
    } else if (root->right and root->right->start <= right and right <= root->right->finish) {
        sum += dfs_range(root->right, left, right);
    }
    return sum;
}

int range_sum_query_mutable::NumArray::sumRange(int left, int right) {
    return dfs_range(head, left, right);
}

